import Link from "next/link";
export default props => {
	console.log("POST", post);
	const { post } = props;
	return (
		<li>
			<Link href="/p/[id]" as={`/p/${props.id}`}>
				{/* <a>{props.title}</a> */}
				<a>{post.title}</a>
			</Link>
		</li>
	);
};
